/* Home.jsx - main javascript file for home page */
import { useEffect } from "react";
import { useState } from "react";
import Featured from "../../components/featured/Featured";
import List from "../../components/list/List";
import Navbar from "../../components/navbar/Navbar";
import "./home.scss";
import axios from "axios";

const Home = ({ type }) => {
    const [lists, setLists] = useState([]);
    const [genre, setGenre] = useState(null);

    useEffect(() => {
      const getRandomLists = async () => {
        try {
          const res = await axios.get(
            `lists${type ? "?type=" + type : ""}${
              genre ? "&genre=" + genre : ""
            }`,
            {
              headers: {
                token:
                "Bearer eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYzMzg5MWI4MDJiYjkwNTBkM2Q3NWE0YyIsImlzQWRtaW4iOnRydWUsImlhdCI6MTY2NDc0ODM4NywiZXhwIjoxNjY1MTgwMzg3fQ.8Knwsr-D9j8ecdPSSTbzm3yFFd6JHFpfwsUd-ViBahM",
              },
            }
          );
          setLists(res.data);
        } catch (err) {
          console.log(err);
        }
      };
      getRandomLists();
    }, [type, genre]);

    return (
      <div className="home">
        <Navbar />
        <Featured type={type} setGenre={setGenre} />
        {lists.map((list) => (
          <List list={list} />
        ))}
      </div>
    );
  };

  export default Home;
